<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="apple-mobile-web-app-capable" content="yes" />
    <meta name="apple-mobile-web-app-title" content="member" />
    <title></title>
    <!--STYLESHEET-->
    <!--=================================================-->
    <!--Open Sans Font [ OPTIONAL ]-->
    <link
      href="https://fonts.googleapis.com/css?family=Open+Sans:400,300,600,700"
      rel="stylesheet"
      type="text/css"
    />
    <!--Bootstrap Stylesheet [ REQUIRED ]-->
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/css/bootstrap.min.css"
      rel="stylesheet"
    />
    <!--Nifty Stylesheet [ REQUIRED ]-->
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/css/nifty.min.css"
      rel="stylesheet"
    />
    <!--Nifty Premium Icon [ DEMONSTRATION ]-->
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/css/demo/nifty-demo-icons.min.css"
      rel="stylesheet"
    />
    <!--DataTables [ OPTIONAL ]-->
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/datatables/media/css/dataTables.bootstrap.css"
      rel="stylesheet"
    />
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/datatables/extensions/Responsive/css/responsive.dataTables.min.css"
      rel="stylesheet"
    />
    <!--Bootstrap Validator [ OPTIONAL ]-->
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/bootstrap-validator/bootstrapValidator.min.css"
      rel="stylesheet"
    />
    <link rel="manifest" href="../manifest.json" />
    <link
      rel="apple-touch-icon"
      sizes="180x180"
      href="../image/icons/apple-touch-icon.png"
    />
    <link
      rel="apple-touch-startup-image"
      href="../image/icons/apple-touch-icon.png"
    />
    <!-- iPhone X, Xs (1125px x 2436px) -->
    <link
      rel="apple-touch-startup-image"
      media="(device-width: 375px) and (device-height: 812px) and (-webkit-device-pixel-ratio: 3)"
      href="../image/icons/apple-touch-icon.png"
    />
    <!-- Custom CSS -->
    <link
      href="//s3auto.sgp1.vultrobjects.com/js_wauto/source/css/default_custom.css"
      rel="stylesheet"
    />
    <!--=================================================-->
  </head>

  <body>
    <div id="container" class="effect aside-float aside-bright mainnav-lg">
      <!--NAVBAR-->
      <!--===================================================-->
      <div id="header"></div>
      <!--===================================================-->
      <!--END NAVBAR-->
      <div class="boxed">
        <!--CONTENT CONTAINER-->
        <!--===================================================-->
        <div id="content-container">
          <div id="page-head"></div>
          <!--Page content-->
          <!--===================================================-->
          <div id="page-content">
            <div class="row">
              <div class="col-lg-8 col-lg-offset-1">
                <div class="panel panel-body text-left">
                  <!-- Panel Header-->
                  <!--===================================================-->
                  <div class="panel-heading">
                    <h3>Your content here...</h3>
                    <hr />
                  </div>
                  <!--===================================================-->
                  <!--End Panel Header-->
                  <!-- Panel Body-->
                  <!--===================================================-->
                  <div class="panel-body">
                    <p>
                      Start putting content on grids or panels, you can also use
                      different combinations of grids. <br />Please check out
                      the dashboard and other pages.
                    </p>
                  </div>
                  <!--===================================================-->
                  <!--End Panel Body-->
                </div>
              </div>
            </div>
          </div>
          <!--===================================================-->
          <!--End page content-->
        </div>
        <!--===================================================-->
        <!--END CONTENT CONTAINER-->

        <!--MAIN NAVIGATION-->
        <!--===================================================-->
        <div id="side_nav"></div>
        <!--===================================================-->
        <!--END MAIN NAVIGATION-->
      </div>
      <!-- FOOTER -->
      <!--===================================================-->
      <div id="footer"></div>
      <!--===================================================-->
      <!-- END FOOTER -->

      <!-- SCROLL PAGE BUTTON -->
      <!--===================================================-->
      <button class="scroll-top btn">
        <i class="pci-chevron chevron-up"></i>
      </button>
      <!--===================================================-->
    </div>
    <!--===================================================-->
    <!-- END OF CONTAINER -->
    <!--JAVASCRIPT-->
    <!--=================================================-->
    <!--jQuery [ REQUIRED ]-->
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/js/jquery.min.js"></script>
    <!--BootstrapJS [ RECOMMENDED ]-->
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/js/bootstrap.min.js"></script>
    <!--DataTables [ OPTIONAL ]-->
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/datatables/media/js/jquery.dataTables.js"></script>
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/datatables/media/js/dataTables.bootstrap.js"></script>
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/datatables/extensions/Responsive/js/dataTables.responsive.min.js"></script>
    <!--Bootstrap Validator [ OPTIONAL ]-->
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/plugins/bootstrap-validator/bootstrapValidator.min.js"></script>
    <!-- Custom JS -->
    <script src="//s3auto.sgp1.vultrobjects.com/js_wauto/source/js/web_custom.js"></script>
    <script src="./js/module_custom.js"></script>
    <!--=================================================-->
  </body>
</html>
